import React from 'react';
import { useNavigate } from 'react-router-dom';

const companies = ['BMW', 'Triumph', 'Enfield', 'Yamaha', 'Kawasaki']; // 5 brands

function TopBikes() {
  const navigate = useNavigate();

  const handleClick = (brand) => {
    navigate('/', { state: { brand } });
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Top Picks from Premium Brands</h1>
      <div style={styles.buttonContainer}>
        {companies.map((brand) => (
          <button
            key={brand}
            onClick={() => handleClick(brand)}
            style={styles.button}
          >
            {brand}
          </button>
        ))}
      </div>
      <p className="note" style={styles.note}>Click a brand above to view bikes on the Home page!</p>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh', // Center content vertically
    textAlign: 'center',
  },
  heading: {
    marginBottom: '20px',
    fontSize: '36px',
  },
  buttonContainer: {
    display: 'flex',
    flexDirection: 'column',
    gap: '15px', // Space between buttons
  },
  button: {
    padding: '10px 20px',
    fontSize: '18px',
    backgroundColor: '#3498db',
    color: 'white',
    border: 'none',
    borderRadius: '25px',
    cursor: 'pointer',
    width: '200px',
    margin: '10px 0',
  },
  note: {
    marginTop: '20px',
    fontSize: '16px',
  },
};

export default TopBikes;
